const HandleClick = () => {
  function handleClick() {
    const element = document.getElementById('bottom-element');
    element.scrollIntoView({ behavior: 'smooth' });
  }
  return (

    <button onClick={handleClick}>Scroll to bottom</button>
  )

}
export default HandleClick
